import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { RouterModule, Routes } from '@angular/router';
import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { AProposDeNousComponent } from './a-propos-de-nous/a-propos-de-nous.component';
import { CompteComponent } from './compte/compte.component';
import { ConseilComponent } from './conseil/conseil.component';
import { ProgrammesEtServicesComponent } from './programmes-et-services/programmes-et-services.component';
import { TesterComponent } from './tester/tester.component';
import { RisqueComponent } from './risque/risque.component';

const routes: Routes = [ { path: 'à propos de nous', component: AProposDeNousComponent },
{ path: 'compte', component: CompteComponent },
{ path: 'conseil', component: ConseilComponent },
{ path: 'programmes & services', component: ProgrammesEtServicesComponent },
{ path: 'risque & prévention', component: RisqueComponent },
{ path: 'tester', component: TesterComponent },
];
@NgModule({
  declarations: [
    AppComponent,
    AProposDeNousComponent,
    CompteComponent,
    ConseilComponent,
    ProgrammesEtServicesComponent,
    TesterComponent,
    RisqueComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    imports: [RouterModule.forRoot(routes)],
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
